import { Container, Content, Headline, Description, RankingStyle } from './styles';
import {GoChevronUp} from 'react-icons/go'

export function Item(){
    return(
        <Container>
            <Ranking />
            <Content>
                <Headline>
                    <a href ='link'>
                        <strong>Embraer delivers 22 jets fighters in first quarter of 2021</strong>
                    </a>
                    <span>
                        <a href='broken'>(www.FlightGlobal.com)</a>
                    </span>

                </Headline>
                <Description>
                    <p>529 points by croes 4 hours ago | 284 comments</p>
                </Description>
            </Content>



        </Container>
    )
}

function Ranking(){
    return(
        <RankingStyle>
            <GoChevronUp size={30} fill='#E8EAED' />
        </ RankingStyle>
    )
}
